                        Last Name: <input type="text" id="firstName" required/>
                    </label>
                    <br /><br />
                    <label>
                        Password: <input type="password" maxLength="8" id="password" required/>
                    </label>
                    <br /><br />
                    <input type="submit" value="Submit" onClick={() => {console.log({userData})}}/>
                </form>
            </div>
        </div>
    );

}

export default LoginPage;
